const about = {
    about: "Hello I am Rafael and I love to build things."
            + "I am 23 years old and was born, raised and now live in beautiful Switzerland."
            + "I am currently studying electrical engineering and information technology at ETH."
            + "Next to my studies I like to read, do various sports and of course improve my coding skills.",
    skills: {
        languages: ["Python", "C++", "JavaScript"],
        frameworks: ["Django", "Flask", "React"],
        databases: ["SQLite", "PostgreSQL"],
        software: ["Lightroom", "Microsoft Office"]
    }
  }

export default about;
